import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link, useParams } from "react-router-dom";
const SingleLaunchPad = () => {
  const { id } = useParams();

  const [data, setData] = useState([]);
  const fetchData = () => {
    axios
      .get(`https://api.spacexdata.com/v4/launchpads/${id}`)
      .then((res) => {
        console.log(res.data);
        setData(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  };
  useEffect(() => {
    fetchData();
  }, []);
  return (
    <div>
      <div>
        <div
          className="container text-light text-start"
          style={{ marginTop: "90px" }}
        >
          <div className="row">
            <div className="col-sm-6">
              <div className="row">
                <div className="col-sm-6">
                  <h3> {data.name}</h3>
                  <p> {data.full_name}</p>
                  <p>locality :{data.locality}</p>
                  <p>region {data.region}</p>
                  <p>
                    Launch Attempt
                    <small className="text-success">

                      : {data.launch_attempts}
                    </small>
                  </p>
                  <p>
                    Succesful
                    <small className="text-success">

                      : {data.launch_successes}
                    </small>
                  </p>

                  <a
                    href=""
                    type="button"
                    className="btn btn-outline-light btn-md"
                  >
                    article
                  </a>

                  <Link
                    to="/launches"
                    type="button"
                    className="btn btn-outline-light btn-md my-2"
                  >
                    Back
                  </Link>
                </div>

                <div className="col-sm-4">
                  {/* <p className="h6">Heat sheild deatil</p> */}
                  <p>Status : {data.status}</p>
                  <p>Ships : {data.timezone}</p>
                  <p>Window:{}</p>
                  {/* <p>: {}</p> */}
                  <small className="text-light"></small>
                  <div>
                    {/* <h6>Other Deatil:</h6> */}
                    {/* <p>
                    failures: */}
                    {/* {launchs.failures === undefined
                      ? "undefined"
                      : launchs.failures.reason} */}
                    {/* {launchs.failures ==="undefined"?launchs.failures.map((fail) => {
                      console.log(fail);
                    }):null} */}
                    {/* </p> */}
                    {/* <p>Presssurize Capsule Payload Volume : {} meter cube</p> */}
                  </div>
                </div>
              </div>
              <p className="card-text text-light my-3">{}</p>
            </div>

            {/* <div className="row"> */}
            <div className="col-sm-6">
              <img
                style={{ width: "700px", height: "350px" }}
                src={
                  data.images === undefined ? "undefined" : data.images.large
                }
                className="img-fluid rounded-2"
                alt="..."
              />
              <h1 className="card-text text-light m-4">
                <small className="text-muted text-center mx-4">{}</small>
              </h1>
            </div>
            {/* </div> */}
            <div>
              <p calssName="h7 text-start">{}</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SingleLaunchPad;
